// NextPage.js

import React from 'react';
import { useLocation } from 'react-router-dom';

function NextPage() {
  const location = useLocation();
  const totalSum = new URLSearchParams(location.search).get('totalSum');

  return (
    <div className='bg'>
      <h2>Premium Price on Next Page</h2>
      <h2 className='premium-price'>{`Premium Price: ${totalSum}`}</h2>
      {/* Add other content or styling as needed */}
    </div>
  );
}

export default NextPage;
